    const title={
        color:'white',
        backgroundColor:'blue',
        padding:'10px',
        textAlign:'center',
        fontSize:'40px',
        fontFamily:'Arial',
        fontWeight:'bold'}  



    function NameChange(){
        const names=["Money"];
        const poss=Math.floor(Math.random());
        return (names[poss]);
        } 
    return(
       <>
            <h1 style ={title}>  To do List</h1>
            <p style={styleHeader}> 
            <p>Lets Earn{NameChange()} </p>
            <button> Click Me</button>
            </p>
        </>    

    )
}

export default Header
